.
 So finally coming to the main one this time! Its all the same ingredients, all the same taste, but, a different look and form.!
.
 We all must have tried ‘Kulfi- Falooda’ at least once but have u seen ‘Falooda Kulfi’? All made from scratch, set at home in moulds of a generous size?
.
 Well here it is, my version of a Kulfi, made of Falooda. A hybrid of kulfi and a popsicle, this is as tasty and instagram worthy.!
.
 Plating is inspired by the royalty associated with Kulfi and hence has got all the little garnish elements right on top adding a vibrancy to the plain pink. 
.
Requirements:
Round white quarter plate @homecentreindia 
Popsicle moulds @homecentreindia 
Milk @amul_india with rose syrup @maprofoods 
Boiled and chilled Vermicelli
Soaked Chia seeds
Homemade tutti frutti from scratch by my Maasi ❤️ @seema.agrawal.98 
Chopped cashews
Vanilla icecream @naturalicecream 
And nothing fancy......
.
Also, don’t forget to check out my story polls where you can give your opinion on the 2 dishes.! 💖👍🏻📶
